// import EditNotice from './components/EditNotice';
// import ProfilePage from './components/StaffProfile';



 
 
  export default function App () {
 
  return (

 
    <div>
    <Header/>
   

    <Router>
      <Routes>
 <Route path='/home' element={<Home/>}/> 
<Route path='/list' element={<ListEmployee/>} /> 
 <Route path='/addemployee' element={<AddEmployee/>} />
 <Route path='/editEmployee/:id' element={<EditEmployee/>} />
 <Route path='/addtimetable' element={<AddTimetable/>}/>
 <Route path='/get' element={<ListTimetable/>}/>
 <Route path='/editTimetable/:id' element={<EditTimetable/>}/>
 <Route path='/report' element={<Report/>}/>
 <Route path='/addNotice' element={<AddNotice/>}/>
 <Route path='/listNotice' element={<ListNotice/>}/>
 <Route path='/editNotice' element={<EditNotice/>}/>
 <Route path='/profile' element={<ProfilePage/>}/>
 
 
 

  
  </Routes>
  </Router>
   
  
     

    
    
    
 
    </div>
  );
}
